function epochlink_json(e){var n=new XMLHttpRequest;e.includes("https://")||e.includes("HTTPS://")||e.includes("http://")||e.includes("HTTP://")||(e="https://"+e);try{if(n.open("GET",e,!1),n.send(),n.status>=200&&n.status<400){var o=n.responseText;return JSON.parse(o)}return console.error("Failed to load data. Status: "+n.status),null}catch(e){return console.error("Request error: "+e.message),null}}function epochlink_unixtime(e){var n=Date.now(),o=epochlink_json(e),t=Date.now();if(o){if("EpochLink"==o.protocol){var r=(t-n)/2/1e3;return o.unix_time<0&&console.warn("Time is negative.\nEpochLink server may be using 32bit."),Math.round(o.unix_time+r)}return console.error("Failed to check protocol.\nProtocol must be EpochLink."),null}return null}function epochlink_unixtime_ms(e){var n=Date.now(),o=epochlink_json(e),t=Date.now();if(o){if("EpochLink"==o.protocol){var r=(t-n)/2;return o.unix_time<0&&console.warn("Time is negative.\nEpochLink server may be using 32bit."),Math.round(o.unix_time_ms+r)}return console.error("Failed to check protocol.\nProtocol must be EpochLink."),null}return null}